CREATE TABLE public.usuarios (    id bigint NOT NULL,    email character varying(255) COLLATE pg_catalog."default",    nome character varying(255) COLLATE pg_catalog."default" NOT NULL,    CONSTRAINT usuarios_pkey PRIMARY KEY (id))TABLESPACE pg_default;ALTER TABLE public.usuarios OWNER to postgres;CREATE SEQUENCE public.seq_usuarios    INCREMENT 1    START 12    MINVALUE 1    MAXVALUE 99999999999999999    CACHE 1;ALTER SEQUENCE public.seq_usuarios OWNER TO postgres;